				"seasonOutlook": "Beal is coming off the best campaign of his career, when he averaged 30.5 PPG, 6.1 APG and 3.0 3PG with a respectable 45.5 FG% and 1.2 SPG, plus an excellent 84.2 FT% on 8.0 FTA. Based purely on his upside as he enters his potential peak at age 27, Beal would be a first-round prospect in fantasy drafts. However, he achieved these heights in the absence of long-time running mate John Wall, who missed the entirety of last season recovering from a ruptured Achilles tendon. Wall was traded to the Rockets, bringing back one of the highest usage players in the NBA in Russell Westbrook. Beal and Westbrook could potentially coexist well as an NBA backcourt because Beal is an excellent off-ball threat, but this arrangement almost certainly caps Beal's ceiling below what he could have produced as a solo act. Even so, he's still unlikely to get out of the second round of most fantasy drafts and has more upside in roto leagues than points, because his efficiency could increase next to Westbrook to counter some of the lost volume.",
