				"seasonOutlook": "Williamson's rookie season was derailed before it began by a knee injury that kept him out for the first 44 games of the season. Even after he returned, he was on a minutes limit to keep him from aggravating his knee. Plus, in Williamson's own words, he was tentative when he returned, because he didn't want to make mistakes. Despite these limitations, Williamson still produced at an incredible per-minute pace on monster efficiency. Per 36 minutes, Williamson averaged 29.1 PP36 (58.3 FG%, 64.0 FT%), 8.1 RP36, 2.7 AP36, 0.9 SP36, 0.5 BP36 and 0.3 3P36 in 24 games. As a sophomore, Williamson has the potential to maintain a similar scoring pace and efficiency while playing more minutes. Also, Williamson averaged 1.8 BPG and 2.1 SPG in college, and those seemed to be the areas that were most afffected by his tentative play last season. If he can return to that type of defensive upside, Williamson has first-round fantasy basketball upside, even though he'll likely carry a second or third round ADP. ",
