				"seasonOutlook": "Warren averaged 18.9 PPG (49.3 FG%, 77.6 FT%) with 4.7 RPG, 1.1 SPG and 0.6 BPG during his last two seasons with the Suns, and he matched those numbers almost verbatim during his first 61 games with the Pacers to the tune of 18.7 PPG (52.9 FG%, 81.2 FT%), 4.0 RPG, 1.1 SPG and 0.4 BPG. However, Warren ignited during his seven regular-season games in the bubble, averaging 31.0 PPG (57.8 FG%, 88.9 FT%), 6.3 RPG, 1.3 SPG and 1.2 BPG. Now, some of that may have been a hot streak -- and the rebounding elevation was clearly due in part to the injury absence of leading rebounder Domantas Sabonis. However, there are reasons for optimism. Warren should be peaking at 27 years old, and he has demonstrated elite 3-point shooting for two seasons in a row now. Plus, the Pacers' lack of an elite scorer limited their upside last season, so Warren should get the green light if he shows any signs of being able to take up that mantle.",
