				"proTeamId": 10,
				"seasonOutlook": "Wall will return to the court this season, almost two full years removed from his last NBA game action, and he will do so on an entirely new team after being swapped for Russell Westbrook. Thus, two big questions arise. After recovering from his Achilles injury, what is the status of the explosiveness that once characterized Wall's game? And, how will Wall's preferred ball-dominant style play next to James Harden on the Rockets? Harden is an elite shooter, much like Bradley Beal was, but Harden operates more off the dribble than perhaps any shooting guard in NBA history. Wall doesn't have the jump shot to be maximized in an off-ball role, and he will have to learn to fit in next to Harden, as he joins the former MVP's team. In addition, will Wall have his minutes monitored as he returns? Will he play both ends of back-to-backs? Wall's upside makes him worthy of consideration relatively early in fantasy drafts, but those questions slide him down a few rounds from his previously lofty status.",
