				"seasonOutlook": "Wood is a 6-foot-10, athletic power forward who had never played more than 21 games in any of his first three seasons in the NBA before getting the chance to shine with the Pistons. He was solid as a backup during his first 48 games of the season, but when Andre Drummond was traded and Blake Griffin was injured, Wood was called on to start down the stretch. He took full advantage of the opportunity, igniting to the tune of 22.6 PPG (55.8 FG%, 76.5 FT%), 9.8 RPG, 1.6 3PG, 0.9 BPG and 0.9 SPG during his last 14 games. This offseason, Wood signed with the Rockets, presumably as a starter, as they end their small-ball experiment from last season. Wood will likely take a volume hit on a team with both James Harden and John Wall, but otherwise has the opportunity to break out in his first full season as an expected impact player.",
