				"seasonOutlook": "Harrell is the reigning NBA Sixth Man of the Year for his work with the Clippers and looks to reprise that role this season after moving across the hallway of the Staples Center to join the Lakers. Harrell is an outstanding finisher with a career 61.4 FG% and is coming off career bests last season of 18.6 PPG and 7.1 RPG. He was the dominant big man for the Clippers last season, even though he came off the bench. However, on the Lakers, he will clearly be subordinate to Anthony Davis and have further competition from new center Marc Gasol. This could eat into Harrell's scoring volume a bit, which hinders his upside because he gets most of his fantasy value from his combination of scoring volume and efficiency. Nevertheless, he's still worthy of consideration in the middle-to-late-middle rounds of fantasy drafts this season.",
