				"proTeamId": 25,
				"seasonOutlook": "Horford is coming off a campaign, during which he had to play out of position at power forward to try to fit in on a mismatched 76ers lineup. Moving to a more perimeter role to get out of Joel Embiid's way negatively affected his ability to block shots on defense and also lowered his field goal percentage and, thus, his scoring potential. On the other hand, he set a new career high with 1.5 3-pointers per game. His rebounding, steals and assists remained similar to his last season with the Celtics. He's now in a new environment, on a talent-bereft Thunder squad with whom he'll be the primary big man. It's a rebuilding squad, and Horford is 34 years old, so he may not pull major minutes, but he has the opportunity to do at the 5 what Chris Paul did last season at the point: show he still has it and make the best of the rebuild. Unless the Thunder trade him again, expect his numbers to return to at least where they were with the Celtics, making him a viable mid-round pick with upside.",
