				"seasonOutlook": "Conley struggled through a nagging hamstring injury in his first season with the Jazz, which ultimately led to his worst statistical season in more than a decade. Conley eventually started getting healthy towards the end of February, and the extended break in the season seemed to help him even more once he got to the bubble. In the small sample of Conley's 11 games played between February 28 and August 8, he posted averages more similar to his norm, with 17.9 PPG (45.2 FG%, 94.6 FT%), 5.6 APG, 3.2 RPG, 2.7 3PG and 1.1 SPG in 33.1 MPG. Those numbers went up even further in his five playoffs games; 19.8 PPG, 5.2 APG, 3.6 3PG. Durability will continue to be a question for the 33-year-old Conley, but if healthy, he has a good chance to bounce back in his second campaign with the Jazz.",
