				"seasonOutlook": "Hield's role with the Kings is murky after a disjointed 2019-20 season. Prior to last season's All-Star break, Hield was the primary starting shooting guard for the Kings and averaged 20.4 PPG, 5.0 RPG, 3.8 3PG and 3.2 APG in 33.4 MPG. After the break, Hield was relegated to a bench role with decreased averages of 15.6 PPG, 3.2 RPG, 3.5 3PG and 2.1 APG in 22.9 MPG. The Kings have since lost Bogdan Bogdanovic, who had started over Hield, but drafted Tyrese Haliburton in this year's NBA draft. There have been reports about Hield clashing with head coach Luke Walton. It is unclear whether Hield will get his starting job back or if Haliburton or Cory Joseph might inherit the role. Hield will knock down 3-pointers at high volume no matter what, but his overall role will determine whether he's worthy of late-early-round fantasy draft consideration or instead more of a middle-round pick.",
