				"seasonOutlook": "Herro had a solid rookie season on the whole, but it was his time in the bubble -- and his in-game snarl that went viral on memes worldwide -- that made him a star. Herro averaged 21.6 PPG, 4.8 RPG, 4.4 APG and 2.2 3PG during the past five regular seasons in the bubble, then followed that up with a memorable playoffs run that reached a high-water mark of 37 points, 6 rebounds, 5 3-pointers and 3 assists in a crucial win over the Celtics in the Eastern Conference Finals. Herro is expected to continue to come off the bench as a sophomore, but he should get close to starter's minutes and is worthy of consideration in the middle rounds of fantasy basketball drafts.",
