				"seasonOutlook": "Fultz got his career back on the right track last season with the Magic, earning the starting job and responding with starter averages of 12.2 PPG (47.4 FG%, 72.3 FT%), 5.4 APG, 3.4 RPG and 1.3 SPG in 28.7 MPG. He still needs to work on his 3-point range, as he turned in a dismal 26.0 3FG% as a starter, but on the whole, this was a major step forward from the struggles of his first couple of seasons with the 76ers. Fultz is locked in as the main lead guard for the Magic and has the upside to take a step forward this season in what is essentially his sophomore campaign. He offers solid value in the middle or late rounds of fantasy drafts.",
