				"seasonOutlook": "Gordon battled injuries most of last season, when he played only 36 games. When he returned, he initially fought major rust, as he attempted to settle in as the third scoring option behind usage monsters James Harden and Russell Westbrook. The break in the season allowed Gordon some extra time to heal, and during the playoffs, he returned to form, averaging 18.5 PPG, 3.2 APG, 2.7 RPG and 2.5 3PG during the first 11 games of the postseason. There are questions for the Rockets heading into the season, with a new front office philosophy and head coach, in addition to trade rumors swirling around Harden and Westbrook. However, one thing that's known is that Gordon is a professional scorer, and if he's healthy and getting normal usage, he should score in the mid-to-upper teens with good 3-point shooting. He is worthy of some consideration late in fantasy drafts.",
